  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:37.291539\",\n\t\"name\": \"biotic-health-of-walnut-creek-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Walnut Creek National Wildlife Refuge is
  in the process of converting over 5,000 acres of agricultural land back to native
  prairie and savanna. The refuge  will consist of 8,654 acres, when land purchase
  is complete. The land use conversion offers the unique opportunity to document changes
  in water quality and biodiversity in an ecosystem undergoing a complete land use
  change. This study aims to determine if biodiversity and biotic health at Walnut
  Creek NWR improve while the surrounding agricultural land is reclaimed as native
  prairie and savanna as well as to determine the water quality of five intermittent
  tributaries of the Walnut Creek watershed.\",\n\t\"license_title\": \"License Not
